import {User} from "./User";


export const Users = (props) => {

    // let users = props.usersData.map( (user)=> <User key={user.id}  status={user.status} fullName={user.fullName} county={user.location.country} city={user.location.city}/>);

    return(
        <div>{
            props.usersData.map((user)=>div)
        }
            <span>
                <div>
                    <img src="" alt=""/>
                </div>
                <div>
                    <button>FOLLOW</button>
                </div>
            </span>
            <span>
                <span>
                    <div>{props.fullName}</div>
                    <div>{props.status}</div>
                </span>
                <span>
                    <div>{props.county}</div>
                    <div>{props.city}</div>
                </span>
            </span>
        </div>
    );
}
